protected void addChildren(Node... children) {
for (Node child: children) {
reparentChild(child);
childNodes.add(child);
child.setSiblingIndex(childNodes.size()-1);
}

void outerHtmlTail(StringBuilder accum, int depth, Document.OutputSettings out) {
if (!(childNodes.isEmpty() && tag.isSelfClosing())) {
if (out.prettyPrint() && !childNodes.isEmpty() && tag.canContainBlock())
indent(accum, depth, out);
accum.append("</").append(tagName()).append(">");
}

private Entities.EscapeMode escapeMode = Entities.EscapeMode.base;
private Charset charset = Charset.forName("UTF-8");
private CharsetEncoder charsetEncoder = charset.newEncoder();
private boolean prettyPrint = true;
private int indentAmount = 1;
public OutputSettings() {}

public Attribute(String key, String value) {
Validate.notEmpty(key);
Validate.notNull(value);
this.key = key.trim().toLowerCase();
this.value = value;
}

public boolean consumeWhitespace() {
boolean seen = false;
while (matchesWhitespace()) {
return seen;
}

public boolean matchesAny(String... seq) {
for (String s : seq) {
if (matches(s))
return true;
}

public String chompToIgnoreCase(String seq) {
String data = consumeToIgnoreCase(seq); // case insensitive scan
matchChomp(seq);
return data;
}

public String chompTo(String seq) {
String data = consumeTo(seq);
matchChomp(seq);
return data;
}

private Element popStackToSuitableContainer(Tag tag) {
while (!stack.isEmpty()) {
if (last().tag().canContain(tag))
return last();
}

private Tag setContainInlineOnly() {
canContainBlock = false;
canContainInline = true;
return this;
}

private Tag setParent(String... tagNames) {
directDescendant = true;
setAncestor(tagNames);
return this;
}

public Element(Tag tag, String baseUri, Attributes attributes) {
super(baseUri, attributes);
Validate.notNull(tag);
this.tag = tag;
}

public Element appendChild(Node child) {
Validate.notNull(child);
addChildren(child);
return this;
}

public String html() {
StringBuilder accum = new StringBuilder();
html(accum);
return accum.toString().trim();
}

public String get(String key) {
Validate.notEmpty(key);
Attribute attr = attributes.get(key.toLowerCase());
return attr != null ? attr.getValue() : "";
}

public static String padding(int width) {
if (width < 0)
if (width < padding.length)
return padding[width];
}

public static Document parse(String html, String baseUri) {
Parser parser = new Parser(html, baseUri, false);
return parser.parse();
}

public TokenQueue(String data) {
Validate.notNull(data);
queue = data;
}

public static TextNode createFromEncoded(String encodedText, String baseUri) {
String text = Entities.unescape(encodedText);
return new TextNode(text, baseUri);
}

public DataNode(String data, String baseUri) {
super(baseUri);
attributes.put(DATA_KEY, data);
}
